--
-- Set up for proportional access
-- 

UPDATE surnames r1 SET high = (SELECT sum(total) FROM surnames r2 WHERE r1.id <= r2.id)::REAL / (SELECT sum(total) FROM surnames);
UPDATE surnames r1 SET low = (SELECT max(r2.high) FROM surnames r2 WHERE r1.high > r2.high);

UPDATE male_names r1 SET high = (SELECT sum(total) FROM male_names r2 WHERE r1.id <= r2.id)::REAL / (SELECT sum(total) FROM male_names);
UPDATE male_names r1 SET low = (SELECT max(r2.high) FROM male_names r2 WHERE r1.high > r2.high);

UPDATE female_names r1 SET high = (SELECT sum(total) FROM female_names r2 WHERE r1.id <= r2.id)::REAL / (SELECT sum(total) FROM female_names);
UPDATE female_names r1 SET low = (SELECT max(r2.high) FROM female_names r2 WHERE r1.high > r2.high);

UPDATE cities r1 SET high = (SELECT sum(population) FROM cities r2 WHERE r1.id <= r2.id)::REAL / (SELECT sum(population) FROM cities);
UPDATE cities r1 SET low = (SELECT max(r2.high) FROM cities r2 WHERE r1.high > r2.high);

CREATE INDEX surnames_low_idx ON surnames(low);
CREATE INDEX surnames_high_idx ON surnames(high);

CREATE INDEX male_names_low_idx ON male_names(low);
CREATE INDEX male_names_high_idx ON male_names(high);

CREATE INDEX female_names_low_idx ON female_names(low);
CREATE INDEX female_names_high_idx ON female_names(high);

CREATE INDEX cities_low_idx ON cities(low);
CREATE INDEX cities_high_idx ON cities(high);

--
-- Create a country of fake people with accurate demographics
--

CREATE TABLE citizens(
	first_name TEXT,
	last_name TEXT,
	gender TEXT,
	occupation TEXT,
  birth_city TEXT,
  birth_state TEXT,
	birthdate DATE,
	social_security TEXT,
	_fulltext tsvector,
	id SERIAL PRIMARY KEY
);

CREATE OR REPLACE FUNCTION populate(count INT) RETURNS void AS $$
DECLARE
  first_name TEXT;
  last_name TEXT;
  gender TEXT;
  occupation TEXT;
  birth_city TEXT;
  birth_state TEXT;
  birthdate DATE;
	social_security TEXT;
BEGIN
	FOR i IN 1..count LOOP
    SELECT name INTO last_name FROM surnames, random() r WHERE low < r AND high > r;
	  IF random() > 0.5 THEN
	    gender := 'FEMALE';
	    SELECT name INTO first_name FROM female_names, random() r WHERE low < r AND high > r;
    ELSE
      gender := 'MALE';
	    SELECT name INTO first_name FROM male_names, random() r WHERE low < r AND high > r;
    END IF;	
	  SELECT name INTO occupation FROM occupations, random() r WHERE id = (r * (SELECT max(id) FROM occupations))::INTEGER;
    SELECT city, state INTO birth_city, birth_state FROM cities, random() r WHERE low < r AND high > r;
	  birthdate := now()::date - (random() * 31025)::integer;
		social_security := (random() * 900 + 100)::integer || '-' || (random() * 90 + 10)::integer || '-' || (random() * 900 + 100)::integer;
	
    INSERT INTO citizens VALUES(first_name, last_name, gender, occupation, birth_city, birth_state, birthdate, social_security,
	                              to_tsvector(first_name || ' ' || last_name || ' ' || occupation || ' ' || birth_city || ' ' || birth_state));
	END LOOP;
END;
$$ LANGUAGE plpgsql;

DROP INDEX IF EXISTS citizens_fulltext_ndx;  -- to speed up row creation

-- SELECT populate(500000);  									 -- this will take about 20-30 minutes
SELECT populate(10000);												-- works without altering unix shmmem

CREATE INDEX citizens_fulltext_ndx ON citizens USING gin(_fulltext);

--
-- Create faceted indices
--

SELECT renumber_table('citizens', '_packed_id');
SELECT recreate_table('_citizens_gender_facet', 'SELECT gender, signature(_packed_id) FROM citizens GROUP BY gender');
SELECT recreate_table('_citizens_occupation_facet', 'SELECT occupation, signature(_packed_id) FROM citizens GROUP BY occupation');
SELECT recreate_table('_citizens_birth_place_facet', 'SELECT ARRAY [ birth_state, birth_city ] AS birth_place, signature(_packed_id) FROM citizens GROUP BY ARRAY [ birth_state, birth_city ]');
SELECT recreate_table('_citizens_birthdate_facet', 'SELECT ARRAY[ EXTRACT(year FROM birthdate), EXTRACT(month FROM birthdate), EXTRACT(day FROM birthdate) ] AS birthdate, signature(_packed_id) FROM citizens GROUP BY birthdate');

CREATE INDEX _citizens_gender_facet_ndx ON _citizens_gender_facet(gender);
CREATE INDEX _citizens_birth_place_facet_ndx ON _citizens_birth_place_facet(birth_place);
CREATE INDEX _citizens_birthdate_facet_ndx ON _citizens_birthdate_facet(birthdate);
